      \u0275\u0275elementStart(55, "p");
      \u0275\u0275text(56, ' \u05D4\u05D1\u05E0\u05D5 \u05E9\u05EA\u05D4\u05DC\u05D9\u05DA \u05D1\u05D7\u05D9\u05E8\u05EA \u05D4\u05E2\u05E5 \u05DB\u05E8\u05D5\u05DA \u05D1"\u05D7\u05D9\u05DB\u05D5\u05DA" \u05E8\u05D1 \u05DE\u05D5\u05DC \u05D1\u05E2\u05DC\u05D9 \u05EA\u05E4\u05E7\u05D9\u05D3\u05D9\u05DD \u05D5\u05D1\u05E2\u05DC\u05D9 \u05E2\u05E0\u05D9\u05D9\u05DF \u05E8\u05D1\u05D9\u05DD, \u05D5\u05E9\u05D9\u05D5\u05EA\u05E8 \u05DE\u05D3\u05D9 \u05DE\u05D0\u05DE\u05E5 \u05DB\u05E8\u05D5\u05DA \u05D1\u05D9\u05E6\u05D9\u05E8\u05EA \u05D7\u05DC\u05D5\u05E4\u05D5\u05EA \u05D5\u05E9\u05E7\u05DC\u05D5\u05DC \u05EA\u05DE\u05D5\u05E8\u05D5\u05EA \u05D1\u05D9\u05DF \u05DE\u05D9\u05E0\u05D9 \u05E2\u05E6\u05D9\u05DD. ');
