      \u0275\u0275elementStart(50, "p")(51, "strong");
      \u0275\u0275text(52, "\u05D0\u05E0\u05D5 \u05DC\u05D0 \u05DE\u05D1\u05E7\u05E9\u05D9\u05DD \u05D5\u05DC\u05D0 \u05E0\u05E9\u05DE\u05D5\u05E8 \u05DE\u05D9\u05D3\u05E2 \u05D0\u05D9\u05E9\u05D9 \u05E9\u05DC\u05DB\u05DD");
      \u0275\u0275elementEnd();
      \u0275\u0275text(53, " \u05D0\u05DC\u05D0 \u05DB\u05DB\u05DC \u05E9\u05EA\u05E9\u05EA\u05DE\u05E9\u05D5 \u05D1\u05D8\u05E4\u05E1\u05D9 \u05D9\u05E6\u05D9\u05E8\u05EA \u05D4\u05E7\u05E9\u05E8, \u05D4\u05E8\u05D9 \u05E9\u05D0\u05E0\u05D5 \u05E0\u05E9\u05DE\u05D5\u05E8 \u05D0\u05E3 \u05D0\u05EA \u05E4\u05E8\u05D8\u05D9 \u05D4\u05E7\u05E9\u05E8 \u05E9\u05E4\u05E8\u05E1\u05DE\u05EA\u05DD \u05E9\u05DD, \u05DC\u05E8\u05D1\u05D5\u05EA \u05E9\u05DD, \u05DB\u05EA\u05D5\u05D1\u05EA \u05D3\u05D5\u05D0\u05E8 \u05D0\u05DC\u05E7\u05D8\u05E8\u05D5\u05E0\u05D9, \u05DE\u05E1\u05E4\u05E8 \u05D4\u05D8\u05DC\u05E4\u05D5\u05DF \u05D5\u05EA\u05D5\u05DB\u05DF \u05D4\u05D4\u05D5\u05D3\u05E2\u05D4.");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(54, "p");
      \u0275\u0275text(55, "\u05DE\u05D9\u05D3\u05E2 \u05D6\u05D4 \u05D9\u05DB\u05D5\u05DC \u05E9\u05D9\u05D4\u05D9\u05D4 \u05DE\u05D9\u05D3\u05E2 \u05DE\u05D6\u05D4\u05D4, \u05D5\u05D9\u05DB\u05D5\u05DC \u05E9\u05D9\u05D4\u05D9\u05D4 \u05DE\u05D9\u05D3\u05E2 \u05E9\u05D0\u05D9\u05E0\u05D5 \u05DE\u05D6\u05D4\u05D4. ");
      \u0275\u0275elementStart(56, "strong");
      \u0275\u0275text(57, "\u05DE\u05DC\u05D1\u05D3 \u05D6\u05D0\u05EA, \u05DB\u05DC \u05D4\u05DE\u05D9\u05D3\u05E2 \u05E9\u05D9\u05E9\u05DE\u05E8 \u05D4\u05D5\u05D0 \u05DE\u05D9\u05D3\u05E2 \u05E1\u05D8\u05D8\u05D9\u05E1\u05D8\u05D9 \u05D5\u05DC\u05D0 \u05DE\u05D6\u05D4\u05D4.");
      \u0275\u0275elementEnd()();
      \u0275\u0275elementStart(58, "h3");
      \u0275\u0275text(59, "\u05DE\u05D4 \u05D4\u05DE\u05D9\u05D3\u05E2 \u05D4\u05DC\u05D0-\u05DE\u05D6\u05D4\u05D4 \u05E9\u05D9\u05E9\u05DE\u05E8 \u05E2\u05DC \u05D0\u05D5\u05D3\u05D5\u05EA\u05D9\u05DB\u05DD?");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(60, "p");
      \u0275\u0275text(61, "\u05D2\u05DD \u05DE\u05D9\u05D3\u05E2 \u05E9\u05D0\u05D9\u05E0\u05D5 \u05DE\u05D6\u05D4\u05D4 \u05E2\u05E9\u05D5\u05D9 \u05E2\u05D3\u05D9\u05D9\u05DF \u05DC\u05D0\u05E4\u05E9\u05E8 \u05DC\u05D0\u05D7\u05E8\u05D9\u05DD \u05DC\u05DC\u05DE\u05D5\u05D3 \u05E2\u05DC \u05D0\u05D5\u05D3\u05D5\u05EA\u05D9\u05DB\u05DD.");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(62, "p");
      \u0275\u0275text(63, "\u05DC\u05DB\u05DF, \u05D7\u05E9\u05D5\u05D1 \u05E9\u05EA\u05D3\u05E2\u05D5 \u05E9\u05D0\u05E0\u05D7\u05E0\u05D5 \u05E9\u05D5\u05DE\u05E8\u05D9\u05DD \u05D0\u05EA \u05D4\u05DE\u05D9\u05D3\u05E2 \u05D4\u05D1\u05D0 \u05D2\u05DD \u05DB\u05DF: \u05DE\u05D9\u05D3\u05E2 \u05D8\u05DB\u05E0\u05D9, \u05DB\u05D2\u05D5\u05DF \u05E1\u05D5\u05D2 \u05D4\u05D3\u05E4\u05D3\u05E4\u05DF \u05D5\u05DE\u05D9\u05D3\u05E2 \u05D1\u05E0\u05D5\u05D2\u05E2 \u05DC\u05EA\u05D5\u05E1\u05E4\u05D9\u05DD \u05D5\u05D4\u05D2\u05D3\u05E8\u05D5\u05EA \u05D1\u05DE\u05DB\u05E9\u05D9\u05E8, \u05DE\u05D9\u05D3\u05E2 \u05D1\u05E0\u05D5\u05D2\u05E2 \u05DC\u05E2\u05DE\u05D5\u05D3\u05D9\u05DD \u05D4\u05E0\u05E6\u05E4\u05D9\u05DD, \u05DC\u05E9\u05D9\u05DE\u05D5\u05E9 \u05D1\u05E9\u05D9\u05E8\u05D5\u05EA \u05D5\u05DB\u05D3\u05D5\u05DE\u05D4 \u05D5\u05DB\u05DF \u05DE\u05D9\u05D3\u05E2 \u05D8\u05DB\u05E0\u05D9 \u05E9\u05D9\u05EA\u05E7\u05D1\u05DC \u05D1\u05DE\u05D4\u05DC\u05DA \u05D4\u05EA\u05E7\u05E9\u05D5\u05E8\u05EA \u05E2\u05DE\u05DB\u05DD.");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(64, "h3");
      \u0275\u0275text(65, "\u05DB\u05D9\u05E6\u05D3 \u05DE\u05D9\u05D3\u05E2 \u05E2\u05DC \u05D0\u05D5\u05D3\u05D5\u05EA\u05D9\u05DB\u05DD \u05E0\u05D0\u05E1\u05E3?");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(66, "p");
      \u0275\u0275text(67, "\u05D4\u05DE\u05D9\u05D3\u05E2 \u05E0\u05D0\u05E1\u05E3 \u05D1\u05D0\u05DE\u05E6\u05E2\u05D5\u05EA \u05D9\u05D5\u05DE\u05E0\u05D9 \u05D4\u05E9\u05E8\u05EA \u05D5\u05D1\u05D0\u05DE\u05E6\u05E2\u05D5\u05EA \u05E9\u05D9\u05E8\u05D5\u05EA ");
      \u0275\u0275elementStart(68, "strong");
      \u0275\u0275text(69, "Google Analytics");
      \u0275\u0275elementEnd();
      \u0275\u0275text(70, " \u05D4\u05DE\u05E2\u05D1\u05D3\u05D9\u05DD \u05D0\u05EA \u05D4\u05E0\u05EA\u05D5\u05E0\u05D9\u05DD \u05D4\u05DC\u05D0-\u05DE\u05D6\u05D4\u05D9\u05DD \u05DB\u05D3\u05D9 \u05DC\u05E1\u05E4\u05E7 \u05DC\u05E0\u05D5 \u05EA\u05D5\u05D1\u05E0\u05D5\u05EA \u05E2\u05DC \u05D4\u05E9\u05D9\u05DE\u05D5\u05E9 \u05D1\u05E9\u05D9\u05E8\u05D5\u05EA. \u05DE\u05E2\u05D1\u05E8 \u05DC\u05DB\u05DA, \u05DB\u05DB\u05DC \u05E9\u05EA\u05E6\u05E8\u05D5 \u05D0\u05D9\u05EA\u05E0\u05D5 \u05E7\u05E9\u05E8, \u05D4\u05E8\u05D9 \u05E9\u05E0\u05D0\u05E1\u05D5\u05E3 \u05D0\u05EA \u05D4\u05E4\u05E8\u05D8\u05D9\u05DD \u05E9\u05EA\u05D6\u05D9\u05E0\u05D5 \u05D1\u05D8\u05E4\u05E1\u05D9\u05DD \u05DC\u05E6\u05D5\u05E8\u05DA \u05DE\u05E2\u05E0\u05D4.");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(71, "h3");
      \u0275\u0275text(72, "\u05DB\u05D9\u05E6\u05D3 \u05E0\u05E2\u05E9\u05D4 \u05E9\u05D9\u05DE\u05D5\u05E9 \u05D1\u05DE\u05D9\u05D3\u05E2 \u05E2\u05DC \u05D0\u05D5\u05D3\u05D5\u05EA\u05D9\u05DB\u05DD?");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(73, "p");
      \u0275\u0275text(74, "\u05D0\u05E0\u05D5 \u05E0\u05E9\u05EA\u05DE\u05E9 \u05D1\u05DE\u05D9\u05D3\u05E2 \u05E9\u05E0\u05D0\u05E1\u05E3 \u05E2\u05DC \u05D0\u05D5\u05D3\u05D5\u05EA\u05D9\u05DB\u05DD \u05DC\u05E6\u05D5\u05E8\u05DA \u05DE\u05EA\u05DF \u05D4\u05E9\u05D9\u05E8\u05D5\u05EA, \u05E9\u05D9\u05E4\u05D5\u05E8\u05D5 \u05D5\u05DE\u05E0\u05D9\u05E2\u05EA \u05D4\u05D5\u05E0\u05D0\u05D5\u05EA.");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(75, "h3");
      \u0275\u0275text(76, "\u05DC\u05DE\u05D9 \u05E2\u05D5\u05D3 \u05D9\u05E9 \u05D2\u05D9\u05E9\u05D4 \u05DC\u05DE\u05D9\u05D3\u05E2?");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(77, "p");
      \u0275\u0275text(78, "\u05D4\u05DE\u05D9\u05D3\u05E2 \u05E9\u05DC\u05DB\u05DD \u05E0\u05D2\u05D9\u05E9 \u05DC\u05E2\u05D5\u05D1\u05D3\u05D9\u05DD \u05E9\u05DC\u05E0\u05D5 \u05E9\u05E0\u05DE\u05E6\u05D0\u05D9\u05DD \u05EA\u05D7\u05EA \u05D7\u05D5\u05D1\u05EA \u05E1\u05D5\u05D3\u05D9\u05D5\u05EA; \u05DB\u05DE\u05D5 \u05DB\u05DF, \u05D9\u05EA\u05DB\u05DF \u05DB\u05D9 \u05D1\u05DE\u05E7\u05E8\u05D9\u05DD \u05DE\u05E1\u05D5\u05D9\u05DE\u05D9\u05DD \u05D0\u05E0\u05D7\u05E0\u05D5 \u05E0\u05E1\u05E4\u05E7 \u05D2\u05D9\u05E9\u05D4 \u05D6\u05DE\u05E0\u05D9\u05EA \u05DC\u05DE\u05D9 \u05E9\u05D3\u05E8\u05D5\u05E9\u05D9\u05DD \u05DC\u05E0\u05D5 \u05DC\u05D0\u05E1\u05E4\u05E7\u05EA \u05D4\u05E9\u05D9\u05E8\u05D5\u05EA, \u05EA\u05D7\u05EA \u05D4\u05E1\u05DB\u05DD \u05E2\u05D9\u05D1\u05D5\u05D3 \u05DE\u05D9\u05D3\u05E2 \u05E1\u05E4\u05E6\u05D9\u05E4\u05D9.");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(79, "h3");
      \u0275\u0275text(80, "\u05DE\u05D9\u05D4\u05DD \u05D4\u05E6\u05D3\u05D3\u05D9\u05DD \u05D4\u05E9\u05DC\u05D9\u05E9\u05D9\u05D9\u05DD \u05DC\u05D4\u05DD \u05D9\u05E9 \u05D2\u05D9\u05E9\u05D4?");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(81, "p");
      \u0275\u0275text(82, "\u05E6\u05D3\u05D3\u05D9\u05DD \u05E9\u05DC\u05D9\u05E9\u05D9\u05D9\u05DD \u05D4\u05DD \u05E9\u05D9\u05E8\u05D5\u05EA\u05D9\u05DD \u05D7\u05D9\u05E6\u05D5\u05E0\u05D9\u05D9\u05DD \u05D4\u05DE\u05E7\u05D1\u05DC\u05D9\u05DD \u05D2\u05D9\u05E9\u05D4 \u05DC\u05DE\u05D9\u05D3\u05E2 \u05D5\u05DE\u05E1\u05D9\u05D9\u05E2\u05D9\u05DD \u05DC\u05E0\u05D5 \u05D1\u05DE\u05EA\u05DF \u05D4\u05E9\u05D9\u05E8\u05D5\u05EA.");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(83, "p");
      \u0275\u0275text(84, "\u05D1\u05DE\u05E7\u05E8\u05D4 \u05E9\u05DC\u05E0\u05D5 \u05D0\u05E0\u05D5 \u05DE\u05E9\u05EA\u05DE\u05E9\u05D9\u05DD \u05D1\u05DE\u05E1\u05E4\u05E8 \u05E9\u05D9\u05E8\u05D5\u05EA\u05D9\u05DD \u05DB\u05D3\u05D9 \u05DC\u05E1\u05E4\u05E7 \u05DC\u05DB\u05DD \u05D0\u05EA \u05D4\u05E9\u05D9\u05E8\u05D5\u05EA.");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(85, "p");
      \u0275\u0275text(86, "\u05D0\u05E0\u05D7\u05E0\u05D5 \u05DE\u05E9\u05EA\u05DE\u05E9\u05D9\u05DD \u05D1\u05E9\u05D9\u05E8\u05D5\u05EA\u05D9 ");
      \u0275\u0275elementStart(87, "strong");
      \u0275\u0275text(88, "Google Analytics");
      \u0275\u0275elementEnd();
      \u0275\u0275text(89, " \u05DC\u05E6\u05D5\u05E8\u05DA \u05D0\u05D9\u05E1\u05D5\u05E3 \u05DE\u05D9\u05D3\u05E2 \u05E1\u05D8\u05D8\u05D9\u05E1\u05D8\u05D9 \u05D5\u05E9\u05D9\u05E4\u05D5\u05E8 \u05D4\u05E9\u05D9\u05E8\u05D5\u05EA.");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(90, "h3");
      \u0275\u0275text(91, "\u05DB\u05D9\u05E6\u05D3 \u05D0\u05E0\u05D7\u05E0\u05D5 \u05D9\u05DB\u05D5\u05DC\u05D9\u05DD \u05DC\u05E6\u05D5\u05E8 \u05D0\u05D9\u05EA\u05DB\u05DD \u05E7\u05E9\u05E8?");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(92, "p");
      \u0275\u0275text(93, "\u05D0\u05E0\u05D5 \u05DC\u05D0 \u05E0\u05E6\u05D5\u05E8 \u05E2\u05DE\u05DA \u05E7\u05E9\u05E8 \u05D0\u05DC\u05D0 \u05D1\u05DE\u05E7\u05E8\u05D9\u05DD \u05E9\u05DC \u05D0\u05D9\u05E8\u05D5\u05E2 \u05D0\u05D1\u05D8\u05D7\u05D4 \u05D7\u05DE\u05D5\u05E8.");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(94, "h3");
      \u0275\u0275text(95, "\u05D4\u05D0\u05DD \u05D0\u05EA\u05DD \u05D9\u05DB\u05D5\u05DC\u05D9\u05DD \u05DC\u05E2\u05D9\u05D9\u05DF \u05D1\u05DE\u05D9\u05D3\u05E2, \u05DC\u05EA\u05E7\u05DF \u05D0\u05D5 \u05DC\u05E2\u05D3\u05DB\u05DF \u05DE\u05D9\u05D3\u05E2 \u05D4\u05E0\u05D5\u05D2\u05E2 \u05D0\u05DC\u05D9\u05D9\u05DB\u05DD?");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(96, "p");
      \u0275\u0275text(97, "\u05D1\u05D4\u05EA\u05D0\u05DD \u05DC");
      \u0275\u0275elementStart(98, "strong");
      \u0275\u0275text(99, "\u05E1\u05E2\u05D9\u05E3 13 \u05DC\u05D7\u05D5\u05E7 \u05D4\u05D2\u05E0\u05EA \u05D4\u05E4\u05E8\u05D8\u05D9\u05D5\u05EA");
      \u0275\u0275elementEnd();
      \u0275\u0275text(100, ", \u05D6\u05D5 \u05D6\u05DB\u05D5\u05EA\u05DB\u05DD \u05DC\u05E2\u05D9\u05D9\u05DF \u05D1\u05DE\u05D9\u05D3\u05E2 \u05D4\u05E9\u05DE\u05D5\u05E8 \u05E2\u05DC\u05D9\u05DB\u05DD.");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(101, "p");
      \u0275\u0275text(102, "\u05D1\u05D4\u05EA\u05D0\u05DD \u05DC");
      \u0275\u0275elementStart(103, "strong");
      \u0275\u0275text(104, "\u05E1\u05E2\u05D9\u05E3 14 \u05DC\u05D7\u05D5\u05E7");
      \u0275\u0275elementEnd();
      \u0275\u0275text(105, ", \u05EA\u05D5\u05DB\u05DC\u05D5 \u05DC\u05E2\u05D3\u05DB\u05DF \u05D0\u05D5 \u05DC\u05EA\u05E7\u05DF \u05DE\u05D9\u05D3\u05E2 \u05E9\u05D0\u05D9\u05E0\u05D5 \u05E2\u05D3\u05DB\u05E0\u05D9 \u05E2\u05D5\u05D3.");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(106, "p");
      \u0275\u0275text(107, "\u05E2\u05DC \u05E4\u05D9 \u05D4\u05D7\u05D5\u05E7 \u05D4\u05D9\u05E9\u05E8\u05D0\u05DC\u05D9, \u05D0\u05D9\u05DF \u05D7\u05D5\u05D1\u05D4 \u05DC\u05D0\u05E4\u05E9\u05E8 \u05DC\u05DB\u05DD \u05DC\u05DE\u05D7\u05D5\u05E7 \u05DE\u05D9\u05D3\u05E2, \u05D0\u05DA \u05D0\u05DD \u05EA\u05E4\u05E0\u05D5 \u05DC\u05DE\u05DE\u05D5\u05E0\u05D4 \u05E2\u05DC \u05D4\u05D2\u05E0\u05EA \u05D4\u05E4\u05E8\u05D8\u05D9\u05D5\u05EA \u05D1\u05DE\u05D0\u05D2\u05E8, \u05D0\u05E0\u05D5 \u05E0\u05D5\u05DB\u05DC \u05DC\u05E2\u05D6\u05D5\u05E8 \u05DC\u05DB\u05DD \u05D5\u05DC\u05D1\u05D3\u05D5\u05E7 \u05D4\u05D0\u05DD \u05E0\u05D9\u05EA\u05DF.");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(108, "p");
      \u0275\u0275text(109, "\u05D6\u05DB\u05D5\u05D9\u05D5\u05EA \u05E9\u05DC \u05E0\u05D5\u05E9\u05D0\u05D9 \u05DE\u05D9\u05D3\u05E2 \u05D0\u05D9\u05E8\u05D5\u05E4\u05D0\u05D9\u05DD");
